  `lat` DOUBLE NULL COMMENT '纬度',
  `refjson` JSON NULL COMMENT '相关参考文献的json数组',
  `sourcesid` VARCHAR(50) NULL COMMENT '数据源的id',
  `status` INT NULL DEFAULT 1 COMMENT '状态（默认1、可用；0、不可用）',
