  CONSTRAINT `fk_multimedia_license1`
    FOREIGN KEY (`license_id`)
    REFERENCES `biodata`.`license` (`id`)
    ON DELETE NO ACTION
    ON UPDATE NO ACTION)
ENGINE = InnoDB
COMMENT = '多媒体信息';


